import Sidebar from "./Sidebar";

export default function Dashboard({ children, setPage }) {
  return (
    <div className="flex">
      {/* Pass setPage to Sidebar */}
      <Sidebar setPage={setPage} />

      {/* Main content area */}
      <main className="flex-1 p-6 bg-gray-100">
        {children}
      </main>
    </div>
  );
}
